import React from 'react';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import TextField from '@material-ui/core/TextField';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
import DynamicTable from './DynamicTable';

export default function AddressForm() {

    this.state = { checked: false };
    this.handleChange = this.handleChange3.bind(this);
      function handleChange3() {
        this.setState({
          checked: !this.state.checked
        })
      }



    const hidden = this.state.checked ? '' : 'hidden';
  return (
    <React.Fragment>
      <Typography variant="h6" gutterBottom>
        Personal details
      </Typography>
      <Grid container spacing={3}>
        <Grid item xs={12} sm={6}>
          <TextField
            required
            id="Name"
            name="Name"
            label="Name"
            fullWidth
            autoComplete="given-name"
          />
        </Grid>
        <Grid item xs={12} sm={6}>
          <TextField
            required
            id="Email"
            name="Email"
            label="Email"
            fullWidth
            autoComplete="email"
          />
        </Grid>





        <Grid item xs={12}>
          <FormControlLabel
            control={<Checkbox color="secondary" name="saveAddress" value="yes" id="checks" checked={ this.state.checked } onChange={ this.handleChange3 }/>}
            label="Are there any other owners for the ship?"
          />

        </Grid >
        <Grid item xs={12}>

           <DynamicTable className={ hidden }></DynamicTable> 

        </Grid>
      </Grid>

    </React.Fragment>
  );
}
